  false,\n\t\"url\": null,\n\t\"notes\": \"This data package is comprised of two sets
  of discrete in-situ current velocity measurements from the Agulhas Current Timeseries
  mooring array, from April 2010 to February 2013. Each current meter netCDF file
  in the set represents a single instrument's complete record of east and north velocity
  components, as well as instrument depth, with respect to time. Each ADCP netCDF
  file contains a current profile time series for the same periods. The records have
  been edited to remove samples stored during the deployment and recovery periods,
  and have been corrected for magnetic declination and local sound velocity.\",\n\t\"owner_org\":
  \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
